const itemsPerPage = 4;
let currentPage = 1;

document.addEventListener('DOMContentLoaded', () => {
    loadTiles();
    loadPagination();
    loadChat();

    const chat = document.querySelector('.chat');
    const toggleChatButton = document.getElementById('toggle-chat');
    const closeChatButton = document.getElementById('close-chat');
    const addTileForm = document.getElementById('add-tile-form');
    const tileImageInput = document.getElementById('tile-image');
    const preview = document.querySelector('.preview');
    const uploadText = document.querySelector('.upload-text');

    toggleChatButton.addEventListener('click', () => {
        chat.classList.toggle('active');
    });

    closeChatButton.addEventListener('click', () => {
        chat.classList.remove('active');
    });

    addTileForm.addEventListener('submit', addTile);

    tileImageInput.addEventListener('change', function () {
        const file = this.files[0];
        if (file) {
            const reader = new FileReader();
            reader.onload = function (e) {
                preview.src = e.target.result;
                preview.style.display = 'block';
                uploadText.style.display = 'none';
            }
            reader.readAsDataURL(file);
        }
    });
});

function loadTiles() {
    const tilesContainer = document.getElementById('tiles-container');
    tilesContainer.innerHTML = '';
    const tiles = JSON.parse(localStorage.getItem('tiles')) || [];
    const paginatedTiles = paginate(tiles, itemsPerPage, currentPage);

    paginatedTiles.forEach((tile, index) => {
        const globalIndex = (currentPage - 1) * itemsPerPage + index;
        const tileElement = document.createElement('div');
        tileElement.className = 'tile';
        tileElement.innerHTML = `
            <div class="tile-image-container">
                <div class="tile-image">
                    <img src="${tile.Image}" alt="${tile.Name}" onclick="deleteTile(${globalIndex})">
                </div>
                <button class="delete-tile" onclick="deleteTile(${globalIndex})">
                    <img src="delete.svg" alt="Delete">
                </button>
            </div>
            <div class="tile-content">
                <div class="tile-header">
                    <h3>${tile.Name}</h3>
                    <p>${tile.Price} ₽</p>
                </div>
                <p>${tile.Description}</p>
            </div>
        `;
        tilesContainer.appendChild(tileElement);
    });
}

function loadPagination() {
    const paginationContainer = document.getElementById('pagination');
    paginationContainer.innerHTML = '';
    const tiles = JSON.parse(localStorage.getItem('tiles')) || [];
    const pageCount = Math.ceil(tiles.length / itemsPerPage);

    const prevButton = document.createElement('button');
    prevButton.innerHTML = '&laquo;';
    prevButton.disabled = currentPage === 1;
    prevButton.addEventListener('click', () => {
        if (currentPage > 1) {
            currentPage--;
            loadTiles();
            loadPagination();
        }
    });
    paginationContainer.appendChild(prevButton);

    for (let i = 1; i <= pageCount; i++) {
        const button = document.createElement('span');
        button.textContent = i;
        button.className = i === currentPage ? 'active' : '';
        button.addEventListener('click', () => {
            currentPage = i;
            loadTiles();
            loadPagination();
        });
        paginationContainer.appendChild(button);
    }

    const nextButton = document.createElement('button');
    nextButton.innerHTML = '&raquo;';
    nextButton.disabled = currentPage === pageCount;
    nextButton.addEventListener('click', () => {
        if (currentPage < pageCount) {
            currentPage++;
            loadTiles();
            loadPagination();
        }
    });
    paginationContainer.appendChild(nextButton);
}

function paginate(array, pageSize, pageNumber) {
    return array.slice((pageNumber - 1) * pageSize, pageNumber * pageSize);
}

function deleteTile(globalIndex) {
    let tiles = JSON.parse(localStorage.getItem('tiles')) || [];
    tiles.splice(globalIndex, 1);
    localStorage.setItem('tiles', JSON.stringify(tiles));
    loadTiles();
    loadPagination();
}

function addTile(event) {
    event.preventDefault();
    const name = document.getElementById('tile-name').value;
    const description = document.getElementById('tile-description').value;
    const price = document.getElementById('tile-price').value;
    const imageInput = document.getElementById('tile-image');
    const reader = new FileReader();

    reader.onload = function(event) {
        const image = event.target.result;
        const tiles = JSON.parse(localStorage.getItem('tiles')) || [];

        tiles.push({
            Name: name,
            Description: description,
            Image: image,
            Price: parseInt(price)
        });

        localStorage.setItem('tiles', JSON.stringify(tiles));
        loadTiles();
        loadPagination();
    };

    if (imageInput.files[0]) {
        reader.readAsDataURL(imageInput.files[0]);
    }
}

